import React from "react";

function FullName() {
    return(
        <div>
            <nav>
                <h1>Ahmed Amine Merzougui<br></br>Full Stack Js Developer</h1>
                <table>
                    <tr>
                        <td>HOME</td>
                        <td>RESUME</td>
                        <td>PROJECTS</td>
                        <td>CONTACT</td>
                    </tr>
                </table>
            </nav>
        </div>
    );
}

export default FullName;
